        "import pandas as pd\n",
        "\n",
        "# 1) Load the CSVLogger output\n",
        "df = pd.read_csv(\"/content/drive/MyDrive/cse151b-spring2025-competition_ishan/outputs/2025-05-23/22-32-12/logs/climate/version_0/metrics.csv\")\n",
        "\n",
        "# 2) Select only the validation metrics we care about\n",
        "val_cols = [\n",
        "    \"epoch\",\n",
